import React from "react";
import styled from "styled-components";
import { useHistory } from "react-router-dom";
import { NavLink as Link } from "react-router-dom";
import Home from "../pages/Home";
function Navbar() {

  const history = useHistory();
  const HomeClick = () => history.push("./");
  const BuyClick = () => history.push("./Buy");
  const SellClick = () => history.push("./Sell");
  const ManagedClick = () => history.push("./Managed");
  const AboutAutohub = () => history.push("./AboutAutohub");
  const CCenterClick = () => history.push("./CCenter");
  const JoinClick = () => history.push("./Join");
  const LoginClick = () => history.push("./Login");




  return (
    <Body>
    <Header>
      <HeaderContainer>

<AutohubLogo src="/images/AUTOHUB Logo.png" />

  <HeaderRightList>
<li style={{listStyle:"none",float:"right"}}>살때</li>
<li style={{listStyle:"none",float:"right"}}>팔때</li>
<li style={{listStyle:"none",float:"right"}}>직영차</li>
<li style={{listStyle:"none",float:"right"}}>단지안내</li>
<li style={{listStyle:"none",float:"right"}}>고객센터</li>
  </HeaderRightList>

      </HeaderContainer>
    </Header>

      </Body>
  );
}

const Body = styled.body`
box-sizing: border-box;
margin: 0;
padding: 0;
`
const Header = styled.header`
height: 60px;
background-color:#f11843 ;
color: #fff;
`;
const HeaderContainer = styled.div`

`;

const AutohubLogo = styled.img`
width: 170px;
float: left;
padding-top: 10px;
margin-left: 50px;
cursor: pointer;
`;

const HeaderRightList = styled.ul`
padding: 10px 20px;
margin-top:20px;
`;


export default Navbar;
